import axios from 'axios';

const USER_API_BASE_URL="http://localhost:8000/movies";
class MovieService{

    
    movieAdd(movie){
        return axios.post(USER_API_BASE_URL+'/add',movie,{
        headers:{
            'Content-Type':'application/json'
        }
        });
    }
    
    
}
export default new MovieService();
